    { "title": "LEXAR M.2 NM620 PCIe 1TO 3500Mo/S GEN3X42280", "type": "Pièces Pour PC Fixe", "category": "Disque Dur", "price": 12400, "images": ["https://cdn9.ouedkniss.com/1600/medias/announcements/images/DRx85y/kVtHa8qSGbXNlc8H9OWUGPC6MbZ1vIxwmteehx8z.jpg"], "condition": "SSD", "description": "Interne/Externe Interne\nM.2 ✓\nNVMe PCIe ✓\nGen3x4 ✓\nVitesse de lecture séquentielle Jusqu’à 3500 Mo/s en lecture\nVitesse d’écriture séquentielle Jusqu’à 3000 Mo/s en écriture\nOptimal pour les Passionnés de PC et les Joueurs\n\nDescription du fabricant\nHero banner\nSSD Lexar NM620 M.2 2280 PCIe Gen3x4 NVMe\n\nDes performances de haut niveau pour des charges de travail intensives\nProduct\nSSD Lexar NM620 M.2 2280 PCIe Gen3x4 NVMe\nDes performances fluides pour des flux de travail exigeants\n\nConçu pour les charges de travail intensives, le SSD Lexar NM620 M.2 2280 PCIe Gen3x4 NVMe offre des performances de haut niveau qui vous placent sur la voie de l’informatique rapide avec des vitesses allant jusqu’à 3500 Mo/s en lecture et 3000 Mo/s en écriture (1). Il est pris en charge par le standard technologique PCIe Gen3x4 NVMe 1.4 et construit avec la dernière flash NAND 3D." },
    { "title": "MONITEUR 27 GIGABYTE M27Q P 1MS GTG 165Hz IPS 27 2K QHD 2xHDMI TYPE-C DP2 USB 3.0 SPEAKER JACK", "type": "Ecrans & Data Show", "category": " ", "price": 94900, "images": ["https://cdn7.ouedkniss.com/1600/medias/announcements/images/DRx85y/NegcRCuK83JxfkvywRWCKZIg6mG7gJ22x6ELuQMq.jpg", "https://cdn7.ouedkniss.com/1600/medias/announcements/images/DRx85y/NegcRCuK83JxfkvywRWCKZIg6mG7gJ22x6ELuQMq.jpg", "https://cdn9.ouedkniss.com/1600/medias/announcements/images/DRx85y/ZHskVHriw4RmAbDdxdix83acoLOQfgGUBQwq3JyX.jpg", "https://cdn7.ouedkniss.com/1600/medias/announcements/images/DRx85y/zVLQHJ51kXWMesgKODP2L2q5VlGv6CsiFRRBXq4C.jpg", "https://cdn8.ouedkniss.com/1600/medias/announcements/images/DRx85y/uXgAjnpBtr7e37kXyxp7RkincxH4QkFXpO8wQykp.jpg"], "condition": "Neuf jamais utilisé", "description": "Ecran gaming 170 Hz QHD avec KVM\nPensé pour vous offrir un environnement de jeu le plus agréable possible, l’écran Gigabyte M27Q se pare d’une dalle IPS Super Speed QHD 170 Hz de 27 pouces, d’un temps de réponse de 0.5 ms, de la technologie FreeSync Premium et d’une certification HDR400. Confortable, il est équipé d’un commutateur KVM, d’un pied ajustable en hauteur et de connecteurs HDMI, DisplayPort, USB-C et USB 3.0.\n\nTous les ingrédients pour la réussite\n\nAvec sa dalle IPS Super Speed de 27 pouces, le moniteur Gigabyte M27Q vous offre une immersion visuelle intense pour profiter pleinement de vos jeux préférés. Vous profitez d’une résolution QHD (2560 x 1440 pixels) avec cet écran certifié VESA DisplayHDR 400 capable d’afficher 92% du gamut DCI-P3 et 140% sRGB.\n\nConfortable au quotidien, l’écran gaming M27Q propose un pied ergonomique avec hauteur et inclinaison réglables. Trouvez la position adaptée et bénéficiez de tout le potentiel de votre compagnon gaming. Pratique, une fonction KVM est intégrée pour vous permettre de partager vos périphériques entre plusieurs ordinateurs. Pressez simplement le bouton à l’arrière de l’écran. Côté connectique, vous avez l’embarras du choix ! 2 ports HDMI, un connecteur DisplayPort, un port USB-C et 2 ports USB 3.0 vous attendent.\nLa victoire à l’horizon\n\nPour que la victoire soit belle, ce moniteur Gigabyte intègre des performances gaming supérieures. Il bénéficie notamment de la technologie AMD FreeSync Premium pour vous offrir une belle fluidité sans effet d’image saccadé et un taux de rafraîchissement maximal de 170 Hz ! Enfin, un temps de réponse ultra-rapide de 0.5 ms (MPRT) accompagnera vos envies de triomphe !\n\nD’autres fonctionnalités viennent s’ajouter pour vous faciliter la vie. GameAssist permet notamment d’ajouter un chronomètre, un réticule fixe au centre de l’écran ou de profiter d’un flou réduit lié au recul des armes (Aim Stabilizer). De son côté, Black Equalizer illuminera les scènes sombres pour ne plus vous faire surprendre par un ennemi !\nCaractéristiques principales :\n\nÉcran mat de 27 pouces avec résolution QHD (2560 x 1440)\nDalle 8 bits IPS Super Speed\nGamut couleurs : 92% DCI-P3 / 140% sRGB\nCertification VESA DisplayHDR 400\nContraste : 1000:1 / 12M:1 (DCR)\nTemps de réponse : 0.5 ms (MPRT)\nFréquence de rafraîchissement maximale de 170 Hz\nAMD FreeSync Premium\nConditions gaming optimales : Black Equalizer, Game Assist, Tableau de bord\nConfort oculaire : technologies Low Blue Light et Flicker Free\nPied ergonomique : inclinaison, hauteur réglable (130 mm)\nConnecteurs numériques DisplayPort 1.2 et 2x HDMI 2.0\n2 ports USB 3.0 + 1 port USB-C\nKVM intégré\nAuto-Update : gardez votre écran Gigabyte à jour en temps rée" },
    { "title": "DELL G7 I7 8750H 4.1GHZ 17.3 1MS 144HZ IPS WIN10 RTX2060 6GO DELL G7", "type": "Ordinateurs Portables", "category": "Laptop (Pc Portable)", "price": 159900, "images": ["https://cdn7.ouedkniss.com/1600/medias/announcements/images/DRx85y/Rs99tHTxmThJ6fmjHkl7G2RZ5w6UGihi2mmJ3Ovk.jpg", "https://cdn7.ouedkniss.com/1600/medias/announcements/images/DRx85y/Rs99tHTxmThJ6fmjHkl7G2RZ5w6UGihi2mmJ3Ovk.jpg", "https://cdn8.ouedkniss.com/1600/medias/announcements/images/DRx85y/Zb6vzPmAoPiqN1emjiyxFHoIQdLJy0GjvZp3cOeO.jpg", "https://cdn7.ouedkniss.com/1600/medias/announcements/images/DRx85y/pXxsAejl3asOA9bmQ5EZQ5fSfIcr87eHpjE9kbYJ.jpg", "https://cdn9.ouedkniss.com/1600/medias/announcements/images/DRx85y/yIinb5XjFfwfP9UL2A5slsMKsAazivB3vvlgYGti.jpg", "https://cdn7.ouedkniss.com/1600/medias/announcements/images/DRx85y/UNlOBfT11wZW1d9It7S4MxG9ibisJTTqvNhogJuT.jpg"], "condition": "Dédiée", "description": "DELL G7 I7 8750H 4.1GHZ 17.3″ 1MS 144HZ IPS WIN10 RTX2060 6GO DELL G7\n\nProcesseur Intel Core i7-8750H (Hexa-Core 2.2 GHz / 4.1 GHz Turbo – Cache 9 Mo)\n16 Go de mémoire vive DDR4 2666 MHz (1x 16 Go – maximum 16 Go)\nEcran de 17.3″ avec résolution Full HD (1920 x 1080 pixels) et fréquence de 144 Hz\nDalle IPS : couleurs lumineuses et angles de vision larges\nCarte graphique NVIDIA GeForce RTX 2060 (Max-Q) avec 6 Go de mémoire dédiée GDDR6\nSSD M.2 PCIe de 256 Go\nCommunication sans fil performante : Wi-Fi AC + Bluetooth 5.0\nClavier avec touches rétroéclairées\nWebcam HD 720p\nWindows 10 Famille 64 bits\n\nPERFORMANCES MOBILES POUR LES GAMERS\n\nGagnez en confort et en performance de jeu avec le PC portable Dell G7 17-7790 ! Malgré son design mince et élégant, cet ordinateur est une véritable machine de guerre ! Avec ses composants ultra-performants, son écran IPS 144 Hz, son clavier rétroclairé et son système audio performant, il offre un haut niveau de confort de jeu.\n\nLe PC portable Dell G7 17-7790 (XYR7F) offre de hautes performances de jeu grâce à son processeur Intel Core i7-8750H, ses 16 Go de mémoire DDR4, sa puce graphique NVIDIA GeForce RTX 2060 au format Max-Q et son SSD M.2 PCie de 256 Go.\nPERFORMANCE ET CONFORT DE JEU\nMontrez toute l’étendue de votre talent sur vos jeux préférés grâce aux performances élevées du PC portable Dell G7 17 7790 ! Ce dernier est équipé d’un processeur Intel Core i7 Coffee Lake avec 6 coeurs physiques et 12 threads et d’une puce graphique NVIDIA GeForce RTX 2060 au format Max-Q avec 8 Go de mémoire dédiée. Par ailleurs, avec un écran de 17 pouces avec dalle IPS et fréquence de 144 Hz, le PC portable Dell G7 17-7790 vous offre un affichage ultra-fluide avec des couleurs riches et nuancées. L’idéal pour soutenir vos performances de jeu !\n\n\nGESTION RÉSEAU KILLER\nLe contrôleur Gigabit Ethernet Killer E2500 est conçu pour offrir un haut débit et une expérience de gaming à faible latence, ce qui réduit considérablement les décalages ou l’instabilité. De plus, avec la fonction SmartByte, vous pouvez accorder des niveaux de priorité à vos contenus vidéo.\nALIENWARE COMMAND CENTER\nDell a élaboré des logiciels innovants spécialement conçus pour vous permettre d’améliorer votre expérience de gaming, d’ajuster tous vos paramètres système et de jeu, de résoudre les problèmes et de gérer votre temps. Adaptez vos composants matériels à chacun de vos jeux, personnalisez l’espace et la configuration pour obtenir précisément les interfaces que vous souhaitez, le tout sans interférer avec votre expérience de gaming ni toute autre activité. L’interface conviviale associe tous vos paramètres système à une bibliothèque de gaming, ce qui vous permet d’accéder facilement aux informations sur les jeux. Quelle que soit la source, le logiciel Command Center vous permet d’accéder facilement à vos jeux et de personnaliser les paramètres pour chacun d’eux." }
